import React from 'react'
import { Typography, AppBar, Avatar } from '@mui/material'
import logo from '../assets/shared/logo.svg'


export default function Navbar() {
  return (
    <div>
        <AppBar position='sticky'>
            <Avatar src={logo} />
        </AppBar>
    </div>
  )
}
